(24, 50, 'title', 1, 'MMSC external provisioning task.'),
(24, 50, 'description', 1, 'An external provisioning plug-in for communicating with the TeliaSonera MMSC.'),
(24, 51, 'title', 1, 'Filters out negative invoices for carry over.'),
